import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';
import Typist from 'react-typist';

class Landing extends Component {
    render() {
        return(
            <div className="landing-grid" style = {{width: '100%', margin: 'auto'}}>
                <Grid className="landing-grid">
                    <Cell className="cell-1" col={2}>
                        <img
                        src="https://cdn3.iconfinder.com/data/icons/gundam-colored/48/Cartoons__Anime_Gundam_Artboard_28-512.png"
                        alt="avatar"
                        className="avatar-img"
                        />
                    </Cell>
                    <Cell className="cell-2" col={6}>
                        <div className="banner-text">
                            <Typist>
                            <p1> Recent Computer Science Graduate</p1>
                            </Typist>
                            <hr/>
                            <p2>C | Java | Python | HTML | CSS</p2>
                        </div>
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
